import React from "react";
import { Col } from "react-bootstrap";
import Form from "react-bootstrap/Form";

const BannerTypes = ({ populateBannerText }) => {
  return (
    <Col lg="6">
      <div className="banner-control banner-control-types">
        <h5>Banner Types</h5>
        <Form.Select aria-label="Default select example">
          <option>Open this select menu</option>
          <option value="1">One</option>
          <option value="2">Two</option>
          <option value="3">Three</option>
        </Form.Select>

        <div className="banner-control-types-wrapper">
          <button className="heading banner-control-text-heading">
            Facebook Cover
          </button>

          <button className="heading banner-control-text-subheading">
            Facebook Post
          </button>

          <button className="heading banner-control-text-paragraph">
            Instagram Post
          </button>

          <button className="heading banner-control-text-paragraph">
            Instagram Cover
          </button>
        </div>
      </div>
    </Col>
  );
};

export default BannerTypes;
